import React from "react";
import { IoLogoJavascript } from 'react-icons'
import {
  Card,
  Box,
  Button,
  Image,
  Stack,
  Set,
  Heading,
  Container,
  Columns,
  Text,
  Paragraph,
  Badge,
} from "bumbag";

const Skills = () => (
  <Container padding="2rem 1rem">
    <Heading use="h4" marginBottom="major-4">
      Skills
    </Heading>

    <Set justifyContent="space-between" spacing='minor-1'>
      {/* <Box> */}
        <Card altitude="200" title='Languages' textAlign='center'>
          <Text color='secondary'>Languages</Text>
        </Card>
      {/* </Box> */}

      {/* <Box> */}
        <Card altitude="300" title='Languages' textAlign='center'>
          <Text fontWeight="semibold" textAlign='center'>Languages</Text>
        </Card>
      {/* </Box> */}

      {/* <Box> */}
        <Card altitude="300" title='Languages' textAlign='center'>
          <Text fontWeight="semibold" textAlign='center'>Languages</Text>
        </Card>
      {/* </Box> */}
    </Set>
  </Container>
);

export default Skills;
